import React from "react";
function NumbericSearch({setShowSearch, searchContent}){
    const closeWindow = () => {
        setShowSearch(false);
    };

    return(
        <div className="numberic-search">
            <img className="close-window" src="assets/images/close.png" onClick={closeWindow}></img>
            <div className="numberic-search__heading">Search By {searchContent}</div>
            <form action="/submit_form" method="post" className="numberic-search__form">
                <div className="input-section">
                    <label for="minimum" className="search-label">Min: </label>
                    <input id="minimum" type="text" name="minimum"></input>
                    <label for="minimum"> cm</label>
                </div>
                <div className="input-section">
                    <label for="maximum" className="search-label">Max: </label>
                    <input id="maximum" type="text" name="maximum"></input>
                    <label for="maximum"> cm</label>
                </div>
                <button className="numberic-search__button">SEARCH</button>
            </form>
        </div>
    );
}
export default NumbericSearch;
